import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './store';
import './Home.css';

const Home = () => (
  <div className="feed-container">
    <div className="post-card">
      <div className="post-header">
        <img className="avatar" src="https://randomuser.me/api/portraits/men/32.jpg" alt="avatar" />
        <div className="post-user-info">
          <div className="user-row">
            <span className="username">Shivam Patsariya</span>
            <span className="verified">✔</span>
            <span className="members-only">Members only</span>
          </div>
          <span className="date">2nd March, 2025</span>
        </div>
      </div>
      <div className="post-content">
        <div className="post-title">Main Gate to Remain Closed During Festival Days</div>
        <div className="post-desc">
          The college administration has announced that the main gate will remain closed during the upcoming festival period. The decision aims to reduce traffic congestion on the main road outside the campus, which typically sees increased activity during such events...
        </div>
      </div>
      <img className="post-image" src="https://i.imgur.com/6Iej2c3.jpg" alt="Azam Campus Pune" />
      <div className="post-actions">
        <span>234 ❤️</span>
        <span>15 💬</span>
        <span>10 🔄</span>
      </div>
    </div>
    {/* Add more post-cards here if needed */}
    <div className="bottom-nav">
      <div className="nav-item active">Feed</div>
      <div className="nav-item">Members</div>
      <div className="nav-item">Profile</div>
    </div>
  </div>
);

const About = () => <div>About Page</div>;
const NotFound = () => <div>404 - Page Not Found</div>;

function App() {
  return (
    <Provider store={store}>
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
      </Router>
    </Provider>
  );
}

export default App;
